The Disunited States of Canada

Sociopolitical Documentary hosted by Guylaine Maroist, published by NFB in 2013 - English narration


Information
------------------------------

In this thought provoking documentary that pulls no punches,award-winning filmaker Guylaine Maroist meets with dedicated English Canadian Separatists,politicians,University professors and ordinary citizens who want to reshape Canada.

